int res[100][100],n=100,m=100;
int graph[100][100];
#define V 100


bool bfs(int rGraph[V][V], int s, int t, int parent[])
{
	bool visited[V];
	memset(visited, 0, sizeof(visited));

	queue <int> q;
	q.push(s);
	visited[s] = true;
	parent[s] = -1;

	while (!q.empty())
	{
		int u = q.front();
		q.pop();

		for (int v=0; v<V; v++)
		{
			if (visited[v]==false && rGraph[u][v] > 0)
			{
				q.push(v);
				parent[v] = u;
				visited[v] = true;
			}
		}
	}

	return (visited[t] == true);
}

int fordFulkerson(int graph[V][V], int s, int t)
{
	int u, v;

	int rGraph[V][V]; 
	for (u = 0; u < V; u++)
		for (v = 0; v < V; v++)
			rGraph[u][v] = graph[u][v];

	int parent[V]; 

	int max_flow = 0; 

	while (bfs(rGraph, s, t, parent))
	{

		int path_flow = INT_MAX;
		for (v=t; v!=s; v=parent[v])
		{
			u = parent[v];
			path_flow = min(path_flow, rGraph[u][v]);
		}

		for (v=t; v != s; v=parent[v])
		{
			u = parent[v];
			rGraph[u][v] -= path_flow;
			rGraph[v][u] += path_flow;
		}

		max_flow += path_flow;
	}

	return max_flow;
}




int cost(int ac,int bc){
    int c=0;
    while(!(ac<=0&&bc<=0)){
        c += (ac%10 - bc%10)*(ac%10 - bc%10);
        ac/=10;
        bc/=10;
    }
    return c; 
}



void createGraph(int res1[100][100],int res2[100][100]){
    int k=2;
    
    for(int i=1;i<n-1;i++){
        for(int j=1;j<m-1;j++){
    
            for(int a=-k;a<=k;a++){
                for(int b=-k;b<=k;b++){
                    if(((i+a)>0&&(j+b)>0)&&((i+a)<m-1&&(j+b)<n-1))
                    {
                        graph[i*200+j][(i+a)*200+(j+b)] = sqrt(a*a+b*b)+cost(res1[i][j],res2[i+a][j+b]);
                    }
                }
            }
            
        }
    }
    
    
}



void createLtp(int img[100][100],int n,int m){
    
    for(int i=1;i<n-1;i++){
        for(int j=1;j<m-1;j++){
            int cen = img[i][j];
            int pixels[3][3];
            
            for(int a=-1;a<=1;a++){
                for(int b=-1;b<=1;b++){
                    int val = img[i+a][j+b]-cen;
                    if(val>0)
                        pixels[a+i][b+j] = 2;
                    else if(val<0)
                        pixels[a+i][b+j] = 0;
                    else
                        pixels[a+i][b+j] = 1;
                }
            }
            
            res[i][j] = pixels[0][0]*10000000+pixels[0][1]*1000000+pixels[0][2]*100000+pixels[1][2]*10000+pixels[2][2]*1000+pixels[2][1]*100+pixels[2][0]*10+pixels[1][0];
            
        }
    }
    
    return ;
}


